// import React from 'react';

function Add (num1 , num2) {
    return (num1 + num2);
}
function Sub (num1 , num2) {
    return (num1 - num2);
}
function Sul (num1 , num2) {
    return (num1 * num2);
}

export default Add;

export {Sub};
